package cha04;public class objEquDemo {    public static void main(String[] args) {        int num1 = 10;        int num2 = 20;        int num3 = 10;        System.out.println("num1 == num2 :" + (num1 == num2));        System.out.println("num1 == num3 :" + (num1 == num3));        Integer num4 = 10;        Integer num5 = 20;        Integer num6 = new Integer(10);        Integer num7 = num4;        System.out.println("num4 == num5 :" + (num4 == num5));        System.out.println("num4 == num6 :" + (num4 == num6));        System.out.println("num4 == num7 :" + (num4 == num7));        System.out.println("num4.equals(num6): " + num4.equals(num6));        System.out.println(num4);        System.out.println(num6);    }}